     body{

        #load
        {
            background-image: url();

            background-position: center center;
            background-size: 200px 200px;
            background-repeat: no-repeat;
            text-align: center;
            margin-top: 40vh;
        }

        #breakp
        {
            font-size: 3rem;
            -webkit-animation: apear 3s;
            -webkit-animation-fill-mode: forwards;
            animation: appear 3s;
            animation-fill-mode: forwards;
        }

        @keyframes appear {

            0% {
             font-size: 5px;
            }
            25% {
                font-size: 3rem;
                font-weight: bolder;
               }

               35% {
                letter-spacing:0px;
                }
               60% {
               letter-spacing:10px;
               -webkit-transform: translateY(0%);
               transform: translateY(0%);
               }

               75%
               {
                -webkit-transform: translateY(0%);
                transform: translateY(0%);
                letter-spacing:10px;
               }
               100% {
                -webkit-transform: translateY(1500%);
                transform: translateY(1500%);
                letter-spacing:10px;
                }
          }
          #breakp2
          {
              display:none;
              font-size:2.2rem;
              text-align:center;
              border:2px solid black;
              border-radius :3px;
              -webkit-animation: apear2 1s;
              -webkit-animation-fill-mode: forwards;
              animation: appear2 1s;
              animation-fill-mode: forwards;
              cursor: pointer;
              width: 250px;
          }
          @keyframes appear2 {
              0%
              {
                -webkit-transform: translateY(5%);
                transform: translateY(50%);
                  opacity:0;
              }

           100% {
            -webkit-transform: translateY(0%);
            transform: translateY(0%);
            opacity:1;
            letter-spacing: 1px;
            }
        }

            else if(x==2)

                setTimeout(display,2500);
                document.getElementById("pic").src="pic3.png";
                document.getElementById("info").innerHTML="Dont forget frequency.";
                document.getElementById("breakp2").innerHTML=" RELOAD";
                x=3;
            }
            else{
                document.location.reload(true);
            }
        }
        function display()
        {
            document.getElementById("cod1").style.display="block";
        }
